import { useAuth0 } from "@auth0/auth0-react";
import { Nav } from "react-bootstrap";
import {
  CardList,
  GraphDownArrow,
  HouseFill,
  Images,
  PersonFill,
  PersonFillCheck,
  PersonFillSlash
} from "react-bootstrap-icons";

function Sidebar({setShowWeightModal, setShowDayModal}: any) {
  const { loginWithRedirect } = useAuth0();
  const { logout } = useAuth0();
  const { user, isAuthenticated, isLoading } = useAuth0();

  if (isLoading) {
    return <div>Loading ...</div>;
  }

  return (
    <Nav className="flex-sm-column justify-content-evenly">
      <Nav.Link href="/"><HouseFill /></Nav.Link>
      <Nav.Link href="#" onClick={() => setShowWeightModal(true)}><GraphDownArrow /></Nav.Link>
      <Nav.Link href="#" onClick={() => setShowDayModal(true)}><CardList /></Nav.Link>
      <Nav.Link href="#"><Images /></Nav.Link>
      {isAuthenticated
        ? <Nav.Link href="#" onClick={() => logout({logoutParams: {returnTo: window.location.origin}})}><PersonFillCheck /></Nav.Link>
        : <Nav.Link href="#" onClick={() => loginWithRedirect()}><PersonFillSlash /></Nav.Link>
      }
    </Nav>
  );
}

export default Sidebar;
